control.onControlLoad:
//鼠标点击行激活处理
g5.userId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 10; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 10; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.userId = null;
        return;
    }
    g5.sn = g5.dataset1.getData(0, sender.rowIndex);
    g5.batch = g5.dataset1.getData(1, sender.rowIndex);  
    g5.codeEpc = g5.dataset1.getData(2, sender.rowIndex);
    g5.prodName = g5.dataset1.getData(3, sender.rowIndex);
    g5.manufact = g5.dataset1.getData(4, sender.rowIndex);    
    g5.produceDate = g5.dataset1.getData(5, sender.rowIndex);
    g5.validDate = g5.dataset1.getData(6, sender.rowIndex);  
    g5.id = parseInt(g5.dataset1.getData(7, sender.rowIndex)); 
    g5.position = parseInt(g5.dataset1.getData(8, sender.rowIndex));
}



//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();  

